  <script>
      document.querySelector('body').onmousemove = function clickEvent(e) {
          console.log("Here")
          var rect = e.target.getBoundingClientRect();
          var x = Math.floor((e.clientX - rect.left) / 16); //x position within the element.
          var y = Math.floor((e.clientY - rect.top) / 16);  //y position within the element.
          if (0 <= x && x <= 50 && 0 <= y && y <= 78) {
            document.querySelector('#current-pos').textContent = "(" + (20 + x) + "," + (679 + y) + ")";
          } else {
            document.querySelector('#current-pos').textContent = "Out of bounds";
          }
      }
